import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, Button, CardMenu, IconButton } from 'react-mdl';
import dsalgoImg from './../img/dsalgo-img.jpeg';



class Projects extends Component {

    constructor(props) {
        super(props);
        this.state = {activeTab: 0};
    }

    toggleCategories() {


        if (this.state.activeTab === 0) {
            return(
                <Card shadow={0} style={{width: '512px', margin: 'auto'}}>
                    <CardTitle style={{color: '#fff', height: '176px', background: 'black'}}>Welcome</CardTitle>
                    <CardText>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                        Mauris sagittis pellentesque lacus eleifend lacinia...
                    </CardText>
                    <CardActions border>
                        <Button colored>GitHub</Button>
                        <Button colored>Demo</Button>
                    </CardActions>

                </Card>
            )
        }
        else if (this.state.activeTab === 1) {
            return(
                <div><h1>This is Python</h1></div>
            )
        }
        else if (this.state.activeTab === 2) {
            return(
                <div><h1>This is ML</h1></div>
            )
        }
        else if (this.state.activeTab === 3) {
            return(
                <div><h1>This is Other</h1></div>
            )
        }
        else {
            return(
                <div><h1>This is DS & Algo</h1></div>
            )
        }
    }


    render() {
        return(
            <div className="category-tabs">
                <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({activeTab: tabId})} >
                    <Tab>DS & Algorithms</Tab>
                    <Tab>Python</Tab>
                    <Tab>Machine Learning</Tab>
                    <Tab>Other</Tab>
                </Tabs>

                <section className="projects-grid">
                    <Grid className="projects-grid">
                        <Cell col={12}>
                            <div className="content">
                                {this.toggleCategories()}
                            </div>
                        </Cell>
                    </Grid>
                </section>
            </div>
        )
    }
}


export default Projects;
